syntax = "proto3";

package com.google.cloud.solutions.samples.dataflow.subprocess.examples;

message DataList{

	string key = 2;
	repeated Data dataList=1;
}

message Data{

	string key = 12;

	double d1wRate=1;
	double d1mRate=2;
	double d3mRate=3;
	double d6mRate=4;
	double d9mRate=5;
	double d1yRate=6;
	double s2yRate=7;
	double s3yRate=8;
	double s5yRate=9;
	double s10yRate=10;
	double s15yRate=11;

}
